const ArtistList = ({ artists, onSelect }) => (
  <div>
    <h2 className="encontrados">Artistas encontrados:</h2>
    <ul className="listArt">
      {artists.map((artist) => (
        <li key={artist.id}>
          <button
            onClick={() => onSelect(artist.id, artist.name)}
          >
            
            {artist.name}
          </button>
        </li>
      ))}
    </ul>
  </div>
);
console.log({onSelect});
export default ArtistList;
